PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?dateOfDeath ?archiveInstitution WHERE {
  ?person wdt:P21 wd:Q6581072 .
  {
    ?person wdt:P19 wd:Q3240 .
  } UNION {
    ?person wdt:P20 wd:Q3240 .
  }
  ?person wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) OPTIONAL {
    ?person wdt:P485 ?archiveInstitution
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numPartners ( SUM( IF( ?gender = wd:Q6581072 , ?numArtists , 0 ) ) AS ?numFemales ) ( SUM( IF( ?gender = wd:Q6581097 , ?numArtists , 0 ) ) AS ?numMales ) WHERE {
  VALUES ?occupation {
    wd:Q108289408 wd:Q100951393 wd:Q108290379 wd:Q108290380 wd:Q108290381 wd:Q15855449 wd:Q177220 wd:Q3391743 wd:Q33999
  }
  {
    SELECT ?artist ( COUNT( DISTINCT ?partner ) AS ?numPartners ) ?gender WHERE {
      ?artist wdt:P106 ?occupation ; wdt:P21 ?gender .
      FILTER ( ?gender IN ( wd:Q6581072 , wd:Q6581097 ) ) OPTIONAL {
        ?artist wdt:P451 ?partner
      }
    }
    GROUP BY ?artist ?gender
  }
  {
    SELECT ( COUNT( ?artist ) AS ?numArtists ) ?numPartners ?gender WHERE {
      VALUES ?occupation {
        wd:Q108289408 wd:Q100951393 wd:Q108290379 wd:Q108290380 wd:Q108290381 wd:Q15855449 wd:Q177220 wd:Q3391743 wd:Q33999
      }
      ?artist wdt:P106 ?occupation ; wdt:P21 ?gender .
      FILTER ( ?gender IN ( wd:Q6581072 , wd:Q6581097 ) ) {
        SELECT ?artist ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
          ?artist wdt:P106 ?occupation .
          OPTIONAL {
            ?artist wdt:P451 ?partner
          }
        }
        GROUP BY ?artist
      }
    }
    GROUP BY ?numPartners ?gender
  }
}
GROUP BY ?numPartners
ORDER BY ?numPartners

