SELECT ?category ?categoryLabel ?count WHERE {
  {
    SELECT ?category (COUNT(?entity) AS ?count) WHERE {
      ?entity wdt:P31 ?category .
      ?category wdt:P31 wd:Q56427813 .
    } GROUP BY ?category
  }
  FILTER(?count > 499)
  OPTIONAL { ?category rdfs:label ?categoryLabel FILTER(LANG(?categoryLabel) = "fr") }
}
UNION
{
  SELECT ("AUTRE" AS ?categoryLabel) (SUM(?count) AS ?count) WHERE {
    {
      SELECT ?category (COUNT(?entity) AS ?count) WHERE {
        ?entity wdt:P31 ?category .
        ?category wdt:P31 wd:Q56427813 .
      } GROUP BY ?category
    }
    FILTER(?count <= 499)
  }
}
ORDER BY DESC(?count)

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
SELECT ?settlement ?coord ?lon ?lat ?meznoCoord WHERE {
  VALUES ?type {
    wd:Q532 wd:Q3957
  }
  BIND( "POINT(14.644975 49.534590)" ^^ geo:wktLiteral AS ?meznoCoord ) ?settlement wdt:P31 / wdt:P279 * ?type ; wdt:P17 wd:Q213 ; wdt:P625 ?coord .
  BIND( STRBEFORE( STRAFTER( STR( ?coord ) , "POINT(" ) , " " ) AS ?lon ) BIND( STRBEFORE( STRAFTER( STR( ?coord ) , " " ) , ")" ) AS ?lat ) FILTER ( xsd:decimal ( ?lat ) >= 49.219590 && xsd:decimal ( ?lat ) <= 49.849590 ) FILTER ( xsd:decimal ( ?lon ) >= 14.162975 && xsd:decimal ( ?lon ) <= 15.126975 )
}

