SELECT ?company ?revenue ?revenueUnit ?revenueDate ?netProfit ?profitMargin ?hqLoc WHERE {
  ?company wdt:P31 wd:Q6881511 ; wdt:P159 wd:Q213 .
  FILTER ( ?company != wd:Q100707321 && ?company != wd:Q12021780 ) OPTIONAL {
    ?company p:P2139 ?revenueStatement .
