PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?municipality ?municipalityLabel ?recentPopulation ?recentYear ?pastPopulation ?pastYear WHERE {
  {
    SELECT ?municipality ( MAX( ?year ) AS ?recentYear ) WHERE {
      ?municipality wdt:P31 wd:Q2074737 ; wdt:P131 wd:Q93366 .
      ?municipality p:P1082 ?popStatement .
      ?popStatement pq:P585 ?date .
      BIND( YEAR( ?date ) AS ?year )
    }
    GROUP BY ?municipality
  }
  ?municipality p:P1082 ?recentPopStatement .
  ?recentPopStatement ps:P1082 ?recentPopulation ; pq:P585 ?recentDate .
  BIND( YEAR( ?recentDate ) AS ?recentYearCheck ) FILTER ( ?recentYearCheck = ?recentYear ) OPTIONAL {
    ?municipality rdfs:label ?municipalityLabel FILTER ( LANG( ?municipalityLabel ) = "en" )
  }
  OPTIONAL {
    {
      SELECT ?municipality ( MAX( ?pastYear ) AS ?closestPastYear ) WHERE {
        ?municipality wdt:P31 wd:Q2074737 ; wdt:P131 wd:Q93366 .
        ?municipality p:P1082 ?popStatement2 .
        ?popStatement2 pq:P585 ?pastDate .
        BIND( YEAR( ?pastDate ) AS ?pastYear ) FILTER ( ?pastYear <= ?recentYear - 5 && ?pastYear >= ?recentYear - 15 )
      }
      GROUP BY ?municipality
    }
    ?municipality p:P1082 ?pastPopStatement .
    ?pastPopStatement ps:P1082 ?pastPopulation ; pq:P585 ?pastDate2 .
    BIND( YEAR( ?pastDate2 ) AS ?pastYear ) FILTER ( ?pastYear = ?closestPastYear )
  }
}
ORDER BY ?municipality

