SELECT ?item ?itemLabel ?itemCountry ?itemCountryLabel ?designationCountry ?designationCountryLabel ?coord WHERE {
  {
    SELECT ?item ?itemCountry ?designationCountry ( COUNT( DISTINCT ?designationCountry ) AS ?count ) WHERE {
      ?item wdt:P1435 ?designation .
      ?item wdt:P17 ?itemCountry .
      ?designation wdt:P17 ?designationCountry .
      FILTER ( ?itemCountry != ?designationCountry )
    }
    GROUP BY ?item ?itemCountry ?designationCountry
  }
  {
    SELECT ?item ( COUNT( DISTINCT ?designationCountry ) AS ?numDesignations ) WHERE {
      ?item wdt:P1435 ?designation .
      ?item wdt:P17 ?itemCountry .
      ?designation wdt:P17 ?designationCountry .
      FILTER ( ?itemCountry != ?designationCountry )
    }
    GROUP BY ?item
    HAVING ( ?numDesignations > 1 )
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
  OPTIONAL {
    ?itemCountry rdfs:label ?itemCountryLabel FILTER ( LANG( ?itemCountryLabel ) = "en" )
  }
  OPTIONAL {
    ?designationCountry rdfs:label ?designationCountryLabel FILTER ( LANG( ?designationCountryLabel ) = "en" )
  }
  OPTIONAL {
    ?item wdt:P625 ?coord
  }
}
ORDER BY ?itemLabel ?itemCountryLabel ?designationCountryLabel

