SELECT ?war ?warLabel ?start ?end ?durationDays WHERE {
  ?war wdt:P31 wd:Q198.
  OPTIONAL { ?war rdfs:label ?warLabel FILTER (LANG(?warLabel) = "en") }
  OPTIONAL { ?war wdt:P580 ?start. }
  OPTIONAL { ?war wdt:P582 ?end. }
  OPTIONAL { ?war wdt:P2047 ?durationSeconds. }
  BIND(
    IF(BOUND(?durationSeconds),
      xsd:decimal(?durationSeconds) / 86400,
      IF(BOUND(?start) && BOUND(?end),
        (xsd:decimal(xsd:dateTime(?end)) - xsd:decimal(xsd:dateTime(?start))) / 86400,
        UNDEF
      )
    ) AS ?durationDays
  )
  FILTER(BOUND(?durationDays))
}
ORDER BY ?durationDays ?start
LIMIT 15

